import React, { Component } from "react";

class ContactOne extends Component{
    constructor(props){
        super(props);
        this.state = {
            rnName: '',
            rnEmail: '',
            rnSubject: '',
            rnMessage: '',
        };
    }
    render(){
        return(
            <div className="contact-wrapper" id="contact-wrapper">
            <div className="contact-form--1">
                <div className="container">
                    <div className="row row--35 align-items-start">
                        <div className="col-lg-6 order-2 order-lg-1">
                            <div className="section-title text-left mb--50">
                                <h2 className="title">Contact Me.</h2>
                                <p className="description">I am open to work opportunities.<br /> 
                                Connect with me via <a href="https://www.linkedin.com/in/samiraesquina/" target="_blank" rel="noopener">LinkedIn
                                <a href="https://github.com/Sesquina" target="_blank" rel="noopener"> GitHub</a> 
                                </a> or Email:
                                    <a href="mailto:samiraesquina@gmail.com"> samiraesquina@gmail.com</a> <br/>
                                    <br/>
                                    </p>
                            </div>
                            
                        </div>
                        <div className="col-lg-6 order-1 order-lg-2">
                            <div className="thumbnail mb_md--30 mb_sm--30" id="female">
                                <img src="/assets/images/about/remote.png" alt="female"/>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
            </div>
        )
    }
}
export default ContactOne;
